import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';

function App() {
  return (
    <Container fluid className="p-3 bg-light">
      <Row className="justify-content-center">
        <Col md={8}>
          <h1 className="display-4 text-center">Admin Dashboard</h1>
          <p className="lead text-center">Welcome to the admin dashboard.</p>
        </Col>
      </Row>
    </Container>
  );
}

export default App;
